import { Component } from '@angular/core';

@Component({
  selector: 'ic-footer',
  templateUrl: './footer.component.html',
})
export class FooterComponent {}
<div class="footer">
  <p icTranslate="footer" [style] ="{'margin-left':'25px'}">This is your footer</p>
</div>
